import { Box } from "@mui/material"

export const BlogCard = ({title, image_url}) => { 
    return (
        <Box       height={200}
        width={200}
        my={4}
        display="flex"
        alignItems="center"
        gap={4}
        p={2}
        sx={{ border: '2px solid grey' }}
  > 
        <div className ="blog-card">
            <img src = {image_url} /> 
            <div className ="blog-txt">
                <h4>{title}</h4>
            </div>
        </div>
        </Box>
    )
}
